using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Xpinn.SportsGo.Repositories;
using Xpinn.SportsGo.DomainEntities;
using System.Threading.Tasks;
using System.Collections.Generic;
using Xpinn.SportsGo.Entities;
using Xpinn.SportsGo.Util;

namespace Xpinn.SportsGo.Business.Test
{
    [TestClass]
    public class CategoriasBusinessTest
    {
        [TestMethod]
        public async Task CategoriasBusiness_CrearCategoria_ShouldCreate()
        {
            CategoriasBusiness categoriaRepo = new CategoriasBusiness();

            Categorias categorias = new Categorias
            {
                CategoriasContenidos = new List<CategoriasContenidos>
                {
                    new CategoriasContenidos { CodigoIdioma = 1, Descripcion = "Tenis" },
                    new CategoriasContenidos { CodigoIdioma = 2, Descripcion = "Tennis" }
                },

                ArchivoContenido = Convert.FromBase64String(@""),
            };

            WrapperSimpleTypesDTO wrapperCrearCategoria = await categoriaRepo.CrearCategoria(categorias);

            Assert.IsTrue(wrapperCrearCategoria.Exitoso);
            Assert.AreNotEqual(wrapperCrearCategoria.NumeroRegistrosAfectados, 0);
        }

        [TestMethod]
        public async Task CategoriasBusiness_BuscarCategoria_ShouldCreate()
        {
            CategoriasBusiness categoriaBusiness = new CategoriasBusiness();

            Categorias categoria = new Categorias
            {
                Consecutivo = 3
            };

            var hola = await categoriaBusiness.BuscarCategoria(categoria);

            Assert.IsNotNull(hola);
        }

        [TestMethod]
        public async Task CategoriasBusiness_ModificarCategoriaContenido_ShouldModify()
        {
            CategoriasBusiness categoriaBusiness = new CategoriasBusiness();

            CategoriasContenidos categoria = new CategoriasContenidos
            {
                Consecutivo = 5,
                Descripcion = "Futbol"
            };

            var hola = await categoriaBusiness.ModificarCategoriaContenido(categoria);

            Assert.IsNotNull(hola);
        }

        [TestMethod]
        public async Task CategoriaBusiness_CrearCategoriaCandidatos_ShouldCreate()
        {
            CategoriasBusiness categoriaBusiness = new CategoriasBusiness();

            CategoriasCandidatos categoriaCandidato = new CategoriasCandidatos
            {
                CodigoCandidato = 9,
                CodigoCategoria = 3,
                HabilidadesCandidatos = new List<HabilidadesCandidatos>
                {
                    new HabilidadesCandidatos {  CodigoHabilidad = 2, NumeroEstrellas = 3}
                }
            };

            WrapperSimpleTypesDTO wrapper = await categoriaBusiness.CrearCategoriaCandidatos(categoriaCandidato);

            Assert.IsNotNull(wrapper);
            Assert.IsTrue(wrapper.Exitoso);
        }

        [TestMethod]
        public async Task CategoriaBusiness_CrearCategoriaGrupos_ShouldCreate()
        {
            CategoriasBusiness categoriaBusiness = new CategoriasBusiness();

            SecureMessagesHelper secure = new SecureMessagesHelper();

            CategoriasGrupos categoriaGrupo = await secure.DecryptMessageToEntity<CategoriasGrupos>(@"");

            WrapperSimpleTypesDTO wrapper = await categoriaBusiness.CrearCategoriaGrupos(categoriaGrupo);

            Assert.IsNotNull(wrapper);
            Assert.IsTrue(wrapper.Exitoso);
        }

        [TestMethod]
        public async Task CategoriaBusiness_ModificarCategoriaCandidato_ShouldModify()
        {
            CategoriasBusiness categoriaBusiness = new CategoriasBusiness();

            SecureMessagesHelper secure = new SecureMessagesHelper();

            CategoriasCandidatos categoriaCandidato = await secure.DecryptMessageToEntity<CategoriasCandidatos>(@"");

            WrapperSimpleTypesDTO wrapper = await categoriaBusiness.ModificarCategoriaCandidato(categoriaCandidato);

            Assert.IsNotNull(wrapper);
            Assert.IsTrue(wrapper.Exitoso);
        }
    }
}
